// Generate a menu for a restaurant based on its cuisine types
export function getMenuForRestaurant(restaurant: { cuisineTypes: string[] }): RestaurantMenu {
  // Try to find a matching cuisine template
  for (const cuisine of restaurant.cuisineTypes) {
    if (menuTemplates[cuisine]) {
      return { categories: menuTemplates[cuisine] };
    }
  }
  // Map some common aliases
  const aliasMap: Record<string, string> = {
    'Sushi': 'Japanese', 'Ramen': 'Japanese', 'Izakaya': 'Japanese',
    'Tacos': 'Mexican', 'Burritos': 'Mexican', 'Tex-Mex': 'Mexican',
    'Burgers': 'American', 'Diner': 'American', 'Wings': 'American',
    'Fast Casual': 'American', 'Pub': 'American', 'Sports Bar': 'American',
    'Gastropub': 'American', 'Irish': 'American', 'Bar Food': 'American',
    'New American': 'American', 'Casual Dining': 'American',
    'Pho': 'Vietnamese',
    'Poke': 'Japanese', 'Hawaiian': 'Japanese',
    'Pasta': 'Italian', 'Venetian': 'Italian',
    'Coffee': 'Cafe', 'Coffee & Cafe': 'Cafe',
    'Brunch': 'Breakfast',
    'Ice Cream': 'Desserts',
    'Deli': 'Bakery', 'Sandwiches': 'Bakery',
    'Tapas': 'Spanish', 'Spanish': 'Mediterranean',
    'Lebanese': 'Mediterranean', 'Middle Eastern': 'Mediterranean',
    'Healthy': 'Cafe', 'Vegan': 'Cafe', 'Vegetarian': 'Cafe', 'Organic': 'Cafe', 'Salads': 'Cafe',
    'Sichuan': 'Chinese', 'Asian': 'Chinese', 'Fusion': 'Chinese',
    'Cajun': 'Seafood', 'Oysters': 'Seafood',
    'Latin American': 'Mexican', 'Brazilian': 'BBQ',
  };
  for (const cuisine of restaurant.cuisineTypes) {
    const mapped = aliasMap[cuisine];
    if (mapped && menuTemplates[mapped]) {
      return { categories: menuTemplates[mapped] };
    }
  }
  return { categories: defaultMenu };
}
